def totResistanceShoebox(A_facade, WWR, U_wall, U_glazing, V_dot, A_TM, h_convection):
	Res_1=1/((A_facade*U_wall*(1-WWR))+(A_facade*WWR*U_glazing)+ (V_dot*1.2*1000))
	Res_2 = 1/(A_TM*h_convection)
	Res_tot = Res_1 + Res_2
	return Res_tot

def totResistance(zone_input):
	W, L, H= zone_input['W'],zone_input['L'],zone_input['H']
	WWRs, WWRw, WWRn, WWRe, U_wall, U_roof, U_floor, U_glazing, V_dot, A_TM_factor, h_convection=zone_input['WWRs'],zone_input['WWRw'],zone_input['WWRn'],zone_input['WWRe'],zone_input['U_wall'],zone_input['U_roof'],zone_input['U_floor'],zone_input['U_glazing'],zone_input['V_dot'],zone_input['A_TM_factor'],zone_input['h_convection']
	_s, _w, _n, _e, _r, _f = 0,0,0,0,0,0
	if WWRs!='adiabatic': _s = (L*H*U_wall*(1-WWRs))+(L*H*WWRs*U_glazing)  
	if WWRw!='adiabatic': _w = (W*H*U_wall*(1-WWRw))+(W*H*WWRw*U_glazing)
	if WWRn!='adiabatic': _n = (L*H*U_wall*(1-WWRn))+(L*H*WWRn*U_glazing)
	if WWRe!='adiabatic': _e = (W*H*U_wall*(1-WWRw))+(W*H*WWRw*U_glazing)
	if U_roof!='adiabatic': _r = (W*L*U_roof)
	
	Res_1=1/(_s +_w +_n +_e + _r + (V_dot*1.2*1000))
	Res_2 = 1/(A_TM_factor*L*W*h_convection)
	Res_tot = Res_1 + Res_2
	return Res_tot

def intGain(zone_input,dirqradS_hr,dirqradW_hr,dirqradN_hr,dirqradE_hr,difqradS_hr,ground_temp,zone_temp,AOI_hr,varSHGCbool):
	W, L, H= zone_input['W'],zone_input['L'],zone_input['H']
	WWRs, WWRw, WWRn, WWRe,U_floor=zone_input['WWRs'],zone_input['WWRw'],zone_input['WWRn'],zone_input['WWRe'],zone_input['U_floor']
	SHGC_LDir, SHGC_LDif, SHGC, shadingFac=zone_input['shgc_ldir'],zone_input['shgc_ldif'],zone_input['shgc'],zone_input['shadingFac']

	_allGlazingDir = (L*H*WWRs*dirqradS_hr)+(W*H*WWRw*dirqradW_hr)+(L*H*WWRn*dirqradN_hr)+(W*H*WWRw*dirqradE_hr)
	_allGlazingDif = ((L*H*WWRs)+(W*H*WWRw)+(L*H*WWRn)+(W*H*WWRw))*difqradS_hr
	shgc_tempDir, shgc_tempDif = 0,0
	shgc__LoEe2,shgc__clr = 0.9, 0.42
	shgc__full, shgc__79, shgc__59, shgc__39, shgc__19 = 0.99, 0.72, 0.54, 0.31, 0.1
	shgc__full_dif, shgc__79_dif, shgc__59_dif, shgc__39_dif, shgc__19_dif = 1.1, 0.85, 0.55, 0.3, 0.1
	shgc__69_dif = 0.65
	shgc__29,shgc__49,shgc__69 = 0.2,0.4,0.64
	for a in range (len(SHGC_LDir)):
		if AOI_hr < SHGC_LDir[a][0]: 
			shgc_tempDir = SHGC_LDir[a][1]*shgc__79
			break

	for a in range (len(SHGC_LDif)):
		if AOI_hr < SHGC_LDif[a][0]: 
			shgc_tempDif = SHGC_LDif[a][1]*shgc__79_dif
			break

	# SHGC_ = 0.99
	### if varSHGCbool==0, static SHGC of selected glazing is used. Else if varSHGCbool is 1, then variable SHGC based on solar angle is used.
	if varSHGCbool==0: solarGain = _allGlazingDir*SHGC*shadingFac + _allGlazingDif*shadingFac*SHGC
	else: 
		solarGain = _allGlazingDir*shgc_tempDir*shadingFac + _allGlazingDif*shgc_tempDif*shadingFac

	# _f=0
	# if U_floor!='adiabatic': _f = (W*L*U_floor) #conduction_ground, will be subtracted from zone internal gain as a heat loss
	# conductionGround = _f*(ground_temp-zone_temp)
	# print(solarGain, '  ' , conductionGround)
	# return (solarGain+conductionGround)
	return (solarGain)

def timeConstant(Res_tot, zone_input):
	W, L, A_TM_factor, tickness_TM, cp_TM, density_TM = zone_input['W'],zone_input['L'], zone_input['A_TM_factor'],zone_input['T_TM'],zone_input['cp_TM'],zone_input['density_TM']
	thermalCapacitance = A_TM_factor*W*L*tickness_TM*cp_TM*density_TM
	t_tau = Res_tot * thermalCapacitance #result in seconds. Return result in hr.
	return (t_tau/3600)

def Tin_new (Res_tot, internalLoad, Tout, Tin, timeConstant):
	a = Res_tot*internalLoad + (Tout+273)
	b = 1 - math.exp(-1/timeConstant)
	c = (Tin+273) * math.exp(-1/timeConstant)
	Tin_ = a*b + c 
	return (Tin_-273)

def Qsys (Res_tot, internalLoad, Tout, TinPrevious, Ttarget_L, Ttarget_U, timeConstant):
	# if heating is needed
	qsys_h = 0

	if TinPrevious<=Ttarget_L:
		a = (Ttarget_L+273) - (TinPrevious+273)* math.exp(-1/timeConstant) 	
		b = 1 - math.exp(-1/timeConstant)
		c = a/b - (Tout+273)
		if c/Res_tot > internalLoad:
			qsys_h = (c/Res_tot) - internalLoad

	# if cooling is needed
	if TinPrevious >= Ttarget_U:
		a = (Ttarget_U+273) - (TinPrevious+273)* math.exp(-1/timeConstant)
		b = 1 - math.exp(-1/timeConstant)
		c = a/b - (Tout+273)
		qsys_c = (c/Res_tot) - internalLoad # cooling energy is negative.
	else: qsys_c = 0

	return [qsys_h, qsys_c]

def Qcool (Res_tot, internalLoad, Tout, TinPrevious, Ttarget_U, timeConstant): #for hourly calculation
	qsys_c = 0
	if TinPrevious > Ttarget_U:
		a = (Ttarget_U+273) - (TinPrevious+273)* math.exp(-1/timeConstant)
		b = 1 - math.exp(-1/timeConstant)
		c = a/b - (Tout+273)
		# if c/Res_tot<0:
		qsys_c = (c/Res_tot) - internalLoad # cooling energy is negative.
		# else: qsys_c = -1 * internalLoad
	return qsys_c

def QCoolPredict (TinPrevious,Tin_upper, Tin_comfort, Res_tot,internalLoad,Tout,timeConstant): ##for hourly calculation, Qcool must be in Kwh, internal load uses the same unit.
	v_dotcooling, v_dotcoolingMax = 0.000, 100 # maximum cooling air volume 100m3/s, similar input as in Eplus HVAC model
	rho_air = 1.2 #in kg/m3
	Cp_air = 1000 #in J/kg.K
	Tsupply_min = 18 #in degC 
	Qcool = 0
	internalLoad_ = internalLoad-Qcool
	Tin_predicted = Tin_new (Res_tot, internalLoad_, Tout, TinPrevious, timeConstant)
	while TinPrevious > Tin_upper and Tin_predicted > Tin_upper: # and v_dotcooling<0.05:
		v_dotcooling+=0.001
		Qcool = v_dotcooling*rho_air*Cp_air*(TinPrevious-Tsupply_min)#*3600
		internalLoad_ = internalLoad-Qcool
		Tin_predicted = Tin_new (Res_tot, internalLoad_, Tout, TinPrevious, timeConstant)
	
	return (Qcool, Tin_predicted)

def Qheat (Res_tot, internalLoad, Tout, TinPrevious, Ttarget_L, timeConstant): #for hourly calculation
	# if heating is needed
	qsys_h = 0
	if TinPrevious<Ttarget_L:
		a = (Ttarget_L+273) - (TinPrevious+273)* math.exp(-1/timeConstant) 	
		b = 1 - math.exp(-1/timeConstant)
		c = a/b - (Tout+273)
		if c/Res_tot > internalLoad:
			qsys_h = (c/Res_tot) - internalLoad
	return qsys_h

def QHeatPredict (TinPrevious,Tin_lower, Tin_comfort, Res_tot,internalLoad,Tout,timeConstant): ##for hourly calculation, Qheat must be in Kwh, internal load uses the same unit.
	v_dotheating, v_dotheatingMax, v_dotheatingList = 0.000, 0.3, [] # maximum heating air volume 100m3/s, (to be cross checked with similar input as in Eplus HVAC model)
	rho_air = 1.2 #in kg/m3
	Cp_air = 1000 #in J/kg.K
	Tsupply_max = 30 #in degC 
	Qheat = 0
	internalLoad_ = internalLoad+Qheat
	Tin_predicted = Tin_new (Res_tot, internalLoad_, Tout, TinPrevious, timeConstant)
	while TinPrevious<Tin_lower and Tin_predicted<Tin_lower: # and v_dotheating<0.05: # and v_dotheating<v_dotheatingMax:
		v_dotheating+=0.001
		# v_dotheatingList.append(v_dotheating)
		Qheat = v_dotheating*rho_air*Cp_air*(Tsupply_max-TinPrevious) #*3600
		internalLoad_ = internalLoad+Qheat
		Tin_predicted = Tin_new (Res_tot, internalLoad_, Tout, TinPrevious, timeConstant)
	# print(v_dotheating)
	return (Qheat, Tin_predicted)

def nv_Operable (zone_input, Tin, Tout, wind_angle, wind_speed, Fschedule,operableAreaFraction): #for hourly calculation
	L,W,H,WWRs,WWRw,WWRn,WWRe = zone_input["L"], zone_input["W"],zone_input["H"],zone_input["WWRs"],zone_input["WWRw"],zone_input["WWRn"],zone_input["WWRe"]
	Cwn,Cwe,Cws,Cww=0,0,0,0
	#Based on energyplus, ventilation by wind and stack with open area
	#Wind ventilation
	if wind_angle == 0: Cwn,Cwe,Cws,Cww=0.55,0,0,0
	elif wind_angle == 90: Cwn,Cwe,Cws,Cww=0,0.55,0,0
	elif wind_angle == 180: Cwn,Cwe,Cws,Cww=0,0,0.55,0
	elif wind_angle == 270: Cwn,Cwe,Cws,Cww=0,0,0,0.55
	elif 0<wind_angle<90 : Cwn,Cwe,Cws,Cww=0.3,0.3,0,0
	elif 90<wind_angle<180 : Cwn,Cwe,Cws,Cww=0,0.3,0.3,0
	elif 180<wind_angle<270 : Cwn,Cwe,Cws,Cww=0,0,0.3,0.3
	elif 270<wind_angle<360 : Cwn,Cwe,Cws,Cww=0.3,0,0,0.3

	eff_operableWin_wind = ((L*H*WWRs*Cws)+(W*H*WWRw*Cww)+(L*H*WWRn*Cwn)+(W*H*WWRe*Cwe))*operableAreaFraction
	Qw= eff_operableWin_wind*Fschedule*wind_speed
	# if Qw>0: print ("no opening scenarios   ",WWRn,WWRe,WWRs,WWRw,Cwn,Cwe,Cws,Cww)

	#buoyancy ventilation
	Cd = 0.4 + 0.0045*np.absolute(Tin-Tout)
	Hnpl= H/4 #to be checked based on ASHRAE guidance
	g = 9.8
	eff_operableWin_buoy = ((L*H*WWRs)+(W*H*WWRw)+(L*H*WWRn)+(W*H*WWRe))*operableAreaFraction
	Qs = Cd*eff_operableWin_buoy*Fschedule*np.sqrt(2*g*Hnpl*np.absolute(Tin-Tout)/(Tout+273))
	Q=np.sqrt(np.square(Qw)+np.square(Qs))
	# print ("natural ventilation  ", Q)  
	return (round(Q,3)) ###output in m3/s

## to store discomfort hours from low temperature and high temperatures.
def comfortEval(tempin_, lowerBound, upperBound,occupancy):
	discomfort_coldhrs, discomfort_hothrs = 0,0	
	hr_len = len(tempin_)
	hours = list(range(0,hr_len))
	
	for i in range (0,hr_len):
		if tempin_[i] > upperBound+0.9 and occupancy[i]>0.25: #"+0.9" to match the frequency chart, where all indoor temp between 26 and 26.9 are binned together. 			
			discomfort_hothrs+=1
		if tempin_[i] < lowerBound and occupancy[i]>0.25: 			
			discomfort_coldhrs+=1
	#print (wth+' discomfort hours ', discomforthrs)
	return ((discomfort_coldhrs, discomfort_hothrs))


def monthlyEnergy(hourlyList,area):
	monthlyList = []
	for month in range(12): # for every month in the year
		months = [31,28,31,30,31,30,31,31,30,31,30,31] # the number of days in each month
		d = int(sum(months[:month]))
		numDays = months[month] # the number of days in this month
		monthly = round(sum(hourlyList[d*24:(d+numDays)*24]),1)
		monthlyList.append(monthly/area)
	return (monthlyList)

